const Animallist = ({ animals }) => {
  return (
    <ul>
      {animals.map((animal) => {
        return (
          <li key={animal}>
            {animal}
            {animal === "Dog" && "★"}
          </li>
        );
      })}
    </ul>
  );
};

export default Animallist;
